import tkinter as tk
import pyautogui
import keyboard as kb
from pynput import keyboard
import pyperclip
import json
import os
import time
import pystray
import threading
import base64
from PIL import Image
from io import BytesIO

tray_icon = True

def create_image():
    b64_image_data = ""
    image_data = base64.b64decode(b64_image_data)
    image = Image.open(BytesIO(image_data))

    return image

def on_quit(icon, item):
    icon.stop()
    root.quit()
    os._exit(0)

def on_setup(icon, item):
    root.after(0, root.deiconify)
    root.protocol("WM_DELETE_WINDOW", lambda: on_quit(icon, item))

def setup_tray():
    icon = pystray.Icon("auto_key_icon")
    icon.icon = create_image()
    icon.menu = pystray.Menu(
        pystray.MenuItem("Setup", on_setup),
        pystray.MenuItem("Exit", on_quit)
    )
    icon.run()

registered_hotkeys = []
def start_script():
    global registered_hotkeys

    hotkeys = [
        ('<ctrl>+<alt>+1', entry1.get()),
        ('<ctrl>+<alt>+2', entry2.get()),
        ('<ctrl>+<alt>+3', entry3.get()),
        ('<ctrl>+<alt>+4', entry4.get()),
        ('<ctrl>+<alt>+5', entry5.get()),
        ('<ctrl>+<alt>+6', entry6.get()),
        ('<ctrl>+<alt>+7', entry7.get()),
        ('<ctrl>+<alt>+8', entry8.get()),
        ('<ctrl>+<alt>+9', entry9.get())
    ]

    def auto_type_text(text):
        kb.write(text)
        time.sleep(0.1)

    # Unhook existing hotkeys
    for hotkey in registered_hotkeys:
        hotkey.stop()
    registered_hotkeys.clear()

    # Register new hotkeys
    for hotkey, text in hotkeys:
        if text:  # Only register if text is not empty
            listener = keyboard.GlobalHotKeys({
                hotkey: lambda t=text: auto_type_text(t)
            })
            listener.start()
            registered_hotkeys.append(listener)

    status_label.config(text="AutoKey Running...")

    # Run the system tray icon in a separate thread
    global tray_icon
    if tray_icon:
        threading.Thread(target=setup_tray).start()
        tray_icon = False

    # Hide the Tkinter window only the first time
    if root.state() != 'withdrawn':
        root.withdraw()

def exit_script():
    root.destroy()
    os._exit(0)

def save_inputs():
    inputs = {
        "entry1": entry1.get(),
        "entry2": entry2.get(),
        "entry3": entry3.get(),
        "entry4": entry4.get(),
        "entry5": entry5.get(),
        "entry6": entry6.get(),
        "entry7": entry7.get(),
        "entry8": entry8.get(),
        "entry9": entry9.get()
    }
    with open("inputs.json", "w") as f:
        json.dump(inputs, f)
    status_label.config(text="Hot keys have been saved")

def load_inputs():
    if os.path.exists("inputs.json"):
        with open("inputs.json", "r") as f:
            inputs = json.load(f)
            entry1.insert(0, inputs.get("entry1", ""))
            entry2.insert(0, inputs.get("entry2", ""))
            entry3.insert(0, inputs.get("entry3", ""))
            entry4.insert(0, inputs.get("entry4", ""))
            entry5.insert(0, inputs.get("entry5", ""))
            entry6.insert(0, inputs.get("entry6", ""))
            entry7.insert(0, inputs.get("entry7", ""))
            entry8.insert(0, inputs.get("entry8", ""))
            entry9.insert(0, inputs.get("entry9", ""))

